    public static async Task<object> GetAssetFromBundle(string name)
    {
        AssetBundleRequest request = assetbundle.LoadAssetAsync(name);
        while (!request.isDone) { await Task.Delay(1); }
        if (loadingCanvas != null && loadingIcon != null && loadingText != null)
        {
            loadingText.text = "Loading " + name + "...";
            if (request.asset.GetType() == typeof(Item_Base))
            {
                loadingIcon.sprite = (request.asset as Item_Base).settings_Inventory.Sprite;
            }
            else if (request.asset.GetType() == typeof(AudioClip))
            {
                loadingIcon.sprite = audioclipIcon;
            }
            else
            {
                loadingIcon.sprite = gameobjectIcon;
            }
        }
        return request.asset;
    }

    public void RegisterLampItem(Item_Base item)
    {
        item.settings_buildable.GetBlockPrefab(0).gameObject.AddComponent<Lamp>();
        RegisterPlaceableItem(item, StandardQuadType);
