    public void RegisterSeatItem(Item_Base item)
    {
        if (item.settings_buildable.GetBlockPrefab(0).transform.Find("Seats"))
        {
            item.settings_buildable.GetBlockPrefab(0).gameObject.AddComponent<SeatManager>();
            foreach (Transform t in item.settings_buildable.GetBlockPrefab(0).transform.Find("Seats"))
            {
                t.gameObject.AddComponent<Seat>();
            }
        }
        RegisterPlaceableItem(item, StandardQuadType);
    }

    public void Update()
    {
        if (Semih_Network.InLobbyScene) { return; }
        MessageHandler.ReadP2P_Channel_FurnitureMod();
        CraftingMenu craftingMenu = ComponentManager<CraftingMenu>.Value;
        if (craftingMenu != null)
        {
            Transform CraftingCategories = ComponentManager<CraftingMenu>.Value.transform.Find("CraftingBox_Category").Find("Category VerticalLayoutGroup");
            if (!CraftingCategories.Find("CategoryFurnitureMod"))
            {
                GameObject category = Instantiate(assetbundle.LoadAsset<GameObject>("CategoryFurnitureMod"), new Vector3(), Quaternion.identity, CraftingCategories);
                category.name = "CategoryFurnitureMod";
                category.transform.Find("PageButtons").Find("Page1Button").GetComponent<Button>().onClick.AddListener(() =>
                {
                    craftingMenu.SelectCraftingCategory(FurnitureModCategoryPage1);
                    craftingMenu.selectedCategoryImage.sprite = category.transform.Find("recipe_image").GetComponent<Image>().sprite;
                });
                category.transform.Find("PageButtons").Find("Page2Button").GetComponent<Button>().onClick.AddListener(() =>
                {
                    craftingMenu.SelectCraftingCategory(FurnitureModCategoryPage2);
                    craftingMenu.selectedCategoryImage.sprite = category.transform.Find("recipe_image").GetComponent<Image>().sprite;
                });
            }
        }
    }

    public void RegisterTableItem(Item_Base item)
