public class Lamp : MonoBehaviour, IRaycastable
{
    public bool showingText;
    public bool blockPlaced;
    public CanvasHelper canvas;
    public bool isOn = true;
    public GameObject light;

    public void OnBlockPlaced()
    {
        blockPlaced = true;
    }

    public void Start()
    {
        canvas = ComponentManager<CanvasHelper>.Value;
        light = transform.Find("Light").gameObject;
        if (!Semih_Network.IsHost)
        {
            MessageHandler.SendMessage(new FMessage_RequestLampSyncMessage((Messages)MessageHandler.NetworkMessages.FurnitureMod_RequestLampSync, transform.localPosition));
        }
    }

    public void ToggleLamp()
    {
        isOn = !isOn;
        light.SetActive(isOn);
    }

    public void OnIsRayed()
    {
        if (!blockPlaced) { return; }
        if (canvas == null)
        {
            canvas = ComponentManager<CanvasHelper>.Value;
            return;
        }
        if (CanvasHelper.ActiveMenu != MenuType.None || !Helper.LocalPlayerIsWithinDistance(transform.position, Player.UseDistance))
        {
            if (showingText)
            {
                canvas.displayTextManager.HideDisplayTexts();
                showingText = false;
            }
            return;
        }
        else
        {
            canvas.displayTextManager.ShowText("Press E to turn " + (isOn ? "<color=red>OFF</color>" : "<color=green>ON</color>") + " the lamp!");
            if (Input.GetKeyDown(KeyCode.E))
            {
                ToggleLamp();
                MessageHandler.SendMessage(new FMessage_ToggleLampMessage((Messages)MessageHandler.NetworkMessages.FurnitureMod_ToggleLamp, transform.localPosition, isOn));
            }
        }
        return;
    }

    public void OnRayEnter()
    {
    }

    public void OnRayExit()
    {
        if (showingText)
        {
            canvas.displayTextManager.HideDisplayTexts();
            showingText = false;
        }
    }
}

public class Trampoline : MonoBehaviour
{
    bool placed = false;
    bool wasPreviouslyOn = true;
    Transform point;
    Network_Player localPlayer;
    public static bool hasLanded;
    public static bool PLEASE_RAFT_JUMP;

    public void Start()
    {
        point = transform.Find("TrampolinePoint");
        localPlayer = RAPI.GetLocalPlayer();
    }

    public void OnBlockPlaced()
    {
        placed = true;
    }

    void Jump()
    {
        GameObject t = Instantiate(FurnitureMod.trampoline_particles, localPlayer.transform.position - new Vector3(0, 0, 0), FurnitureMod.trampoline_particles.transform.rotation, transform);
        int clipid = UnityEngine.Random.Range(0, 2);
        t.GetComponent<AudioSource>().PlayOneShot(FurnitureMod.trampoline_audioclips[clipid]);
        Destroy(t, 3f);
        MessageHandler.SendMessage(new FMessage_TrampolineMessage((Messages)MessageHandler.NetworkMessages.FurnitureMod_Trampoline, t.transform.position, clipid));
    }

    public void LateUpdate()
    {
        if (!placed) { return; }
        if (!localPlayer)
        {
            localPlayer = RAPI.GetLocalPlayer();
            return;
        }
        if (Vector3.Distance(localPlayer.transform.position, point.position) < 1)
        {
            localPlayer.PersonController.jumpSpeed = 15f;
            if (localPlayer.PersonController.controller.isGrounded)
            {
                wasPreviouslyOn = true;

                localPlayer.PersonController.justLanded = false;
                PLEASE_RAFT_JUMP = true;
                Jump();
            }
        }
        else if (wasPreviouslyOn)
        {
            wasPreviouslyOn = false;
            RAPI.GetLocalPlayer().PersonController.jumpSpeed = 8f;
        }
    }
}

public class Toilet : MonoBehaviour
{
    Chair chair;
    DateTime lastFart = DateTime.Now;
    GameObject farttext;

    void Start()
    {
        chair = GetComponentInParent<Chair>();
        GameObject f = FurnitureMod.farttext;
        f.SetActive(false);
        farttext = Instantiate(f, transform);
    }

    public void Update()
    {
        if (RAPI.GetLocalPlayer() == null) { return; }
        if (RAPI.GetLocalPlayer().PlayerNetworkManager.currentChair == chair)
        {
            farttext.SetActive(true);
            if (Input.GetKeyDown(KeyCode.F) && CanvasHelper.ActiveMenu == MenuType.None && DateTime.Now > lastFart.AddSeconds(1.1f))
            {
                lastFart = DateTime.Now;
                GameObject t = Instantiate(FurnitureMod.toilet_particles, transform.Find("SitPosition").position, FurnitureMod.toilet_particles.transform.rotation);
                int clipid = UnityEngine.Random.Range(0, 4);
                t.GetComponent<AudioSource>().PlayOneShot(FurnitureMod.toilet_audioclips[clipid]);
                Destroy(t, 3f);
                MessageHandler.SendMessage(new FMessage_FartMessage((Messages)MessageHandler.NetworkMessages.FurnitureMod_Fart, t.transform.position, clipid));
            }
        }
        else
        {
            farttext.SetActive(false);
        }
    }
}

