    {
        if (!small)
        {
            effect = FurnitureMod.rubbishbinparticles;
        }
        else
        {
            effect = FurnitureMod.smallrubbishbinparticles;
        }
    }

    public void Update()
    {
        if (inventory != null)
        {
            slot = inventory.allSlots[0];
            if (slot != null && slot.itemInstance != null && !slot.IsEmpty)
            {
                slot.RemoveItem(slot.itemInstance.Amount);
                Instantiate(effect, transform.position, transform.rotation, transform);
                slot.itemInstance = null;
            }
        }
        else
        {
            inventory = GetComponent<Storage_Small>().GetInventoryReference();
        }
    }
}

