public class Seat : MonoBehaviour_Network, IRaycastable
{
    public bool blockPlaced;
    public bool Occupied
    {
        get
        {
            return currentSittingPlayer != null;
        }
    }
    private Transform sitTransform;
    public CanvasHelper canvas;
    public Semih_Network network;
    public Network_Player currentSittingPlayer;
    public bool canStand;

    public void Start()
    {
        canvas = ComponentManager<CanvasHelper>.Value;
        network = ComponentManager<Semih_Network>.Value;
        sitTransform = transform.GetChild(0);
    }

    protected override void OnDestroy()
    {
        base.OnDestroy();
        if (canvas != null)
        {
            canvas.displayTextManager.HideDisplayTexts();
        }
        if (Occupied)
        {
            Stand();
        }
    }

    void LateUpdate()
    {
        if (!blockPlaced) { return; }
        if (currentSittingPlayer != null && !currentSittingPlayer.IsLocalPlayer)
        {
            currentSittingPlayer.transform.rotation = sitTransform.rotation;
        }
    }

    private void Update()
    {
        if (!blockPlaced) { return; }
        if (currentSittingPlayer != RAPI.GetLocalPlayer())
        {
            bool found = false;
            foreach (KeyValuePair<CSteamID, Network_Player> p in ComponentManager<Semih_Network>.Value.remoteUsers)
            {
                if (Vector3.Distance(p.Value.transform.position, sitTransform.transform.position) < 0.1 && p.Value != RAPI.GetLocalPlayer())
                {
                    Sit(p.Value);
                    found = true;
                }
            }
            if (!found)
            {
                Stand();
            }
        }

        if (!Occupied)
        {
            return;
        }
        if (!currentSittingPlayer.IsLocalPlayer)
        {
            currentSittingPlayer.transform.position = sitTransform.position;
        }
        else if (currentSittingPlayer.currentModel.thirdPersonSettings.ThirdPersonModel)
        {
            currentSittingPlayer.playerPivot.localEulerAngles = Vector3.zero;
            currentSittingPlayer.transform.rotation = sitTransform.rotation;
        }
        else
        {
            currentSittingPlayer.transform.localEulerAngles = new Vector3(0f, currentSittingPlayer.transform.eulerAngles.y, 0f);
        }
        bool flag = !currentSittingPlayer.IsLocalPlayer || currentSittingPlayer.currentModel.thirdPersonSettings.ThirdPersonModel;
        if (currentSittingPlayer.Animator.anim.GetBool("Sitting") != flag)
        {
            currentSittingPlayer.Animator.anim.SetBool("Sitting", flag);
        }
        if (currentSittingPlayer.IsLocalPlayer)
        {
            if (!ChatTextFieldController.IsChatWindowSelected)
            {
                canvas.displayTextManager.ShowText(Helper.GetTerm("Game/Stand", false), MyInput.Keybinds["Interact"].MainKey, 1, 0, true);
                if (canStand && MyInput.GetButtonDown("Interact"))
                {
                    canvas.displayTextManager.HideDisplayTexts();
                    Stand();
                    return;
                }
            }
            else
            {
                canvas.displayTextManager.HideDisplayTexts();
            }
        }
    }

    private void Sit(Network_Player player)
    {
        if (!blockPlaced) { return; }
        currentSittingPlayer = player;
        currentSittingPlayer.transform.position = sitTransform.position;
        currentSittingPlayer.transform.rotation = sitTransform.rotation;
        currentSittingPlayer.PlayerNetworkManager.currentChair = null;
        if (currentSittingPlayer.IsLocalPlayer)
        {
            currentSittingPlayer.PersonController.enabled = false;
            currentSittingPlayer.PersonController.IsMovementFree = false;
            currentSittingPlayer.PlayerItemManager.SelectUsable(null);
            currentSittingPlayer.cameraBobAnimator.SetBool("InWater", false);
            currentSittingPlayer.cameraBobAnimator.SetFloat("Speed", 0f);
            PlayerItemManager.IsBusy = true;
            canStand = false;
            base.CancelInvoke("ResetStand");
            base.Invoke("ResetStand", 0.2f);
        }
        currentSittingPlayer.PersonController.ResetPlayerPivotToOriginal();
        if (!currentSittingPlayer.IsLocalPlayer || currentSittingPlayer.currentModel.thirdPersonSettings.ThirdPersonModel)
        {
            currentSittingPlayer.Animator.anim.SetBool("Sitting", true);
        }
    }

    public void Stand()
    {
        if (!blockPlaced) { return; }
        if (currentSittingPlayer == null) { return; }
        if (currentSittingPlayer.IsLocalPlayer)
        {
            currentSittingPlayer.PersonController.enabled = true;
            if (!currentSittingPlayer.UsingNoclip)
            {
                currentSittingPlayer.PersonController.IsMovementFree = true;
            }
            currentSittingPlayer.transform.position = currentSittingPlayer.transform.position + currentSittingPlayer.transform.up * 1;
            PlayerItemManager.IsBusy = false;
            canStand = false;
            currentSittingPlayer.Inventory.hotbar.ReselectCurrentSlot();
        }
        currentSittingPlayer.Animator.anim.SetBool("Sitting", false);
        currentSittingPlayer.PlayerNetworkManager.currentChair = null;
        currentSittingPlayer = null;
    }

    private void ResetStand()
    {
        canStand = true;
    }

    public void OnIsRayed()
    {
        if (!blockPlaced) { return; }
        if (canvas == null)
        {
            return;
        }
        if (network == null)
        {
            network = ComponentManager<Semih_Network>.Value;
        }
        if (network == null)
        {
            Debug.Log("Semih_Network reference is null in Chair.OnIsRayed()");
            return;
        }
        Network_Player localPlayer = network.GetLocalPlayer();
        if (localPlayer == null || localPlayer.BedComponent == null || localPlayer.BedComponent.Sleeping)
        {
            return;
        }
        if (Occupied || CanvasHelper.ActiveMenu != MenuType.None || PlayerItemManager.IsBusy)
        {
            canvas.displayTextManager.HideDisplayTexts();
            return;
        }
        if (Helper.LocalPlayerIsWithinDistance(base.transform.position, Player.UseDistance))
        {
            canvas.displayTextManager.ShowText(Helper.GetTerm("Game/Sit", false), MyInput.Keybinds["Interact"].MainKey, 0, 0, true);
            if (MyInput.GetButtonDown("Interact"))
            {
                canvas.displayTextManager.HideDisplayTexts();
                Sit(network.GetLocalPlayer());
            }
        }
        else
        {
            canvas.displayTextManager.HideDisplayTexts();
        }
    }

    public void OnRayEnter()
    {
    }

    public void OnRayExit()
    {
        if (canvas != null)
        {
            canvas.displayTextManager.HideDisplayTexts();
        }
    }
}


public class MessageHandler : MonoBehaviour
{
    public enum NetworkMessages
    {
        FurnitureMod_Fart = 7000,
        FurnitureMod_Trampoline = 7001,
        FurnitureMod_RequestLampSync = 7002,
        FurnitureMod_ToggleLamp = 7003,

    }

    public static void SendMessage(Message message)
    {
        if (Semih_Network.IsHost)
        {
            RAPI.GetLocalPlayer().Network.RPC(message, Target.Other, EP2PSend.k_EP2PSendReliable, (NetworkChannel)71);
        }
        else
        {
            RAPI.GetLocalPlayer().SendP2P(message, EP2PSend.k_EP2PSendReliable, (NetworkChannel)71);
        }
    }

    public static void ReadP2P_Channel_FurnitureMod()
    {
        if (Semih_Network.InLobbyScene) { return; }
        uint num;
        while (SteamNetworking.IsP2PPacketAvailable(out num, 71))
        {
            byte[] array = new byte[num];
            uint num2;
            CSteamID csteamID;
            if (SteamNetworking.ReadP2PPacket(array, num, out num2, out csteamID, 71))
            {
                MemoryStream serializationStream = new MemoryStream(array);
                BinaryFormatter bf = new BinaryFormatter();
                bf.Binder = new PreMergeToMergedDeserializationBinder();
                Packet packet = bf.Deserialize(serializationStream) as Packet;
                Packet_Multiple packet_Multiple;
                if (packet.PacketType == PacketType.Single)
                {
                    Packet_Single packet_Single = packet as Packet_Single;
                    packet_Multiple = new Packet_Multiple(packet_Single.SendType);
                    packet_Multiple.messages = new Message[]
                    {
                        packet_Single.message
                    };
                }
                else
                {
                    packet_Multiple = (packet as Packet_Multiple);
                }
                List<Message> list = packet_Multiple.messages.ToList();
                for (int i = 0; i < list.Count; i++)
                {
                    Message message = list[i];
                    if (message != null)
                    {
                        Messages type = message.Type;
                        switch (type)
                        {
                            case (Messages)NetworkMessages.FurnitureMod_Fart:
                                {
                                    FMessage_FartMessage msg = message as FMessage_FartMessage;
                                    GameObject t = Instantiate(FurnitureMod.toilet_particles, msg.position, FurnitureMod.toilet_particles.transform.rotation);
                                    t.GetComponent<AudioSource>().PlayOneShot(FurnitureMod.toilet_audioclips[msg.clipid]);
                                    Destroy(t, 3f);
                                    break;
                                }
                            case (Messages)NetworkMessages.FurnitureMod_Trampoline:
                                {
                                    FMessage_TrampolineMessage msg = message as FMessage_TrampolineMessage;
                                    GameObject t = Instantiate(FurnitureMod.trampoline_particles, msg.position, FurnitureMod.trampoline_particles.transform.rotation);
                                    t.GetComponent<AudioSource>().PlayOneShot(FurnitureMod.trampoline_audioclips[msg.clipid]);
                                    Destroy(t, 3f);
                                    break;
                                }
                            case (Messages)NetworkMessages.FurnitureMod_RequestLampSync:
                                {
                                    if (!Semih_Network.IsHost) { return; }
                                    FMessage_RequestLampSyncMessage msg = message as FMessage_RequestLampSyncMessage;
                                    foreach (Lamp l in FindObjectsOfType<Lamp>())
                                    {
                                        if (l.transform.localPosition == msg.position)
                                        {
                                            SendMessage(new FMessage_ToggleLampMessage((Messages)NetworkMessages.FurnitureMod_ToggleLamp, l.transform.localPosition, l.isOn));
                                            return;
                                        }
                                    }
                                    break;
                                }
                            case (Messages)NetworkMessages.FurnitureMod_ToggleLamp:
                                {
                                    FMessage_ToggleLampMessage msg = message as FMessage_ToggleLampMessage;
                                    foreach (Lamp l in FindObjectsOfType<Lamp>())
                                    {
                                        if (l.transform.localPosition == msg.position)
                                        {
                                            l.isOn = !msg.state;
                                            l.ToggleLamp();
                                        }
                                    }
                                    break;
                                }
                        }
                    }

                }
            }
        }
    }
}

